implementation.script:
tw.local.scriptName = "ClientManagement";
//tw.local.rpaRestEndpoint = "https://services-emea.skytap.com:8505";
tw.local.rpaRestEndpoint = tw.env.rpaServer;

// Onboarding Info
tw.local.onboardingInfo = new tw.object.toolkit.COTK.OnboardingInformation();

// Client
tw.local.onboardingInfo.client = new tw.object.toolkit.COTK.Client();

// Name
tw.local.onboardingInfo.client.name = tw.local.caseProperties.ClientName.value;

// Address
tw.local.onboardingInfo.client.address = new tw.object.toolkit.COTK.Address();
tw.local.onboardingInfo.client.address.unit = tw.local.caseProperties.AddressUnit.value;
tw.local.onboardingInfo.client.address.street = tw.local.caseProperties.AddressStreet.value;
tw.local.onboardingInfo.client.address.zipCode = tw.local.caseProperties.AddressZipCode.value;
tw.local.onboardingInfo.client.address.state = tw.local.caseProperties.AddressState.value;
tw.local.onboardingInfo.client.address.city = tw.local.caseProperties.AddressCity.value;
tw.local.onboardingInfo.client.address.country = tw.local.caseProperties.AddressCountry.value;

// Point of Contact
tw.local.onboardingInfo.client.primaryContact = new tw.object.toolkit.COTK.PrimaryContact();
tw.local.onboardingInfo.client.primaryContact.firstName = tw.local.caseProperties.FirstName.value;
tw.local.onboardingInfo.client.primaryContact.lastName = tw.local.caseProperties.LastName.value;
tw.local.onboardingInfo.client.primaryContact.email = tw.local.caseProperties.Email.value;
tw.local.onboardingInfo.client.primaryContact.phoneNumber = tw.local.caseProperties.PhoneNumber.value;

// Additional Information
tw.local.onboardingInfo.client.additionalInformation = new tw.object.toolkit.COTK.ClientInformation();
tw.local.onboardingInfo.client.additionalInformation.annualRevenue = tw.local.caseProperties.AnnualRevenue.value;
tw.local.onboardingInfo.client.additionalInformation.companyAge = tw.local.caseProperties.CompanyAge.value;
tw.local.onboardingInfo.client.additionalInformation.numberOfEmployees = tw.local.caseProperties.NumberOfEmployees.value;
tw.local.onboardingInfo.client.additionalInformation.defaultedPayment = tw.local.caseProperties.DefaultedPayment.value;

// Segment
tw.local.onboardingInfo.segment = tw.local.caseProperties.Segment.value;

// Approval Status
tw.local.onboardingInfo.approvalStatus = tw.local.caseProperties.ApprovalStatus.value;

// Requested Services
tw.local.onboardingInfo.servicesInfo = new tw.object.toolkit.COTK.ServicesInformation();
tw.local.onboardingInfo.servicesInfo.servicesFee = tw.local.caseProperties.ServicesFee.value;
tw.local.onboardingInfo.servicesInfo.industry = tw.local.caseProperties.Industry.value;
//tw.local.onboardingInfo.servicesInfo.servicesRequested = tw.local.caseProperties.ServicesRequested.value;
tw.local.onboardingInfo.servicesInfo.servicesRequested = "";
var signedServices = tw.local.caseProperties.ServicesRequested.value;
if(!!signedServices && signedServices.listLength > 0) {
	for(var i=0; i < signedServices.listLength; i++) {
		tw.local.onboardingInfo.servicesInfo.servicesRequested = tw.local.onboardingInfo.servicesInfo.servicesRequested + signedServices[i];
		if ( i < signedServices.listLength-1)
		{
			tw.local.onboardingInfo.servicesInfo.servicesRequested = tw.local.onboardingInfo.servicesInfo.servicesRequested + ",";
		}
	}
}

var currentUser = tw.local.caseProperties.UserID.value.toLowerCase();

if (currentUser == tw.env.rpaBotExecutionUser) {
	tw.local.executeRPABot = true; 
} else {
	tw.local.executeRPABot = false;
}

tw.local.inputPayload = new tw.object.toolkit.IBMRPAT.OnboardingInfoPayload();
tw.local.inputPayload.onboardingInfo = JSON.stringify(tw.local.onboardingInfo);
tw.local.payload = JSON.stringify(tw.local.inputPayload);

tw.local.baseURL = tw.env.rpaServer;
